import axios from 'axios';
import {
  REGISTER_USER,
} from './types';



// Register User
export const register = formData =>  dispatch => {
 
  try {
    const res =  axios.post('http://localhost:5000/register', formData);
    return {
      type: REGISTER_USER,
      payload: res.data
    }
   } catch (err) {
    console.log(err);
  }
};
